import React from 'react';
import { Sliderpicture } from './SliderData';

const ImgageSlider = () => {
    return (
        <div>
            {Sliderpicture.map((slider, indedex)=>{
                return(
                    <img src={slider.image} alt="travel image" />
                )
            })}
        </div>
    );
};

export default ImgageSlider;
